function eventLoop(p,f)
	if mode == "fly" then
		loop=loop+1
	end
	if f < 1000 then
		rodar()
		mode="building"
	end
	if p > 120000 then
		if mode == "building" then
			mode="fly"
		end
		for n,player in pairs(tfm.get.room.playerList) do
			if player.y < 125 and p > 120000 and mode=="fly" then
				tfm.exec.giveCheese(n)
				tfm.exec.playerVictory(n)
				mode="ending"
			end
			if player.y < 450 and data[n].reached == false then
				data[n].reached=true
				data[n].message=data[n].message+1
